function () {  

  var REDIRECT_COOKIE_NAME = "optimizelyRedirect";
  redirect = {};
  integrator = {};

  /**
   * Returns an array of Experiment IDs active on the page, as well as includes the ID of the experiment of the experiment that might have redirected the user to the page
   * @return {Array.<string>}
   */
  integrator.getRelevantExperimentIds = function () {
      var activeExperimentIds = window.optimizely.data.state.activeExperiments;
      var exps = activeExperimentIds || [];
      // Grab the variation id from the cookie if present
      var redirectVariationId = redirect.getRedirectVariationId();
      if (redirectVariationId) {
          exps.push(integrator.getExperimentId(redirectVariationId));
      }
      return exps;
  };

  /**
   * Returns Experiment ID from variation ID
   * @returns {string} experimentId
   */
  integrator.getExperimentId = function(variationId){
      var experimentId;
      for (var exp_id in optimizely.data.experiments){
          var exp = optimizely.data.experiments[exp_id];
          if (exp.variation_ids.indexOf(variationId) > -1){
              experimentId = exp_id;
              break;
          }
      }
      return experimentId;
  }

  /**
   * Returns cookie
   * @return {<cookie>}
   */
  redirect.getRedirectCookie = function () {
      return cookie.get(REDIRECT_COOKIE_NAME);
  };

  /**
   * Returns the variationId read from the redirect cookie.
   * @returns {string} variationId
   */
  redirect.getRedirectVariationId = function () {
      redirect.initializeRedirectVariationId();
      return redirect.variationId;
  }

  /**
   * Pull the variation Id out of the cookie before it expires.
   */
  redirect.initializeRedirectVariationId = function () {
      var redirectCookie = redirect.getRedirectCookie() || "|";
      redirect.variationId = redirectCookie.split("|")[0];
  };

  /**
   * The cookie library
   */
  window.cookie = {
      get: function (sKey) {
          if (!sKey) {
              return null;
          }
          return decodeURIComponent(document.cookie.replace(new RegExp("(?:(?:^|.*;)\\s*" + encodeURIComponent(sKey).replace(/[\-\.\+\*]/g, "\\$&") + "\\s*\\=\\s*([^;]*).*$)|^.*$"), "$1")) || null;
      },
      set: function (sKey, sValue, vEnd, sPath, sDomain, bSecure) {
          if (!sKey || /^(?:expires|max\-age|path|domain|secure)$/i.test(sKey)) {
              return false;
          }
          var sExpires = "";
          if (vEnd) {
              switch (vEnd.constructor) {
                  case Number:
                      sExpires = vEnd === Infinity ? "; expires=Fri, 31 Dec 9999 23:59:59 GMT" : "; max-age=" + vEnd;
                      break;
                  case String:
                      sExpires = "; expires=" + vEnd;
                      break;
                  case Date:
                      sExpires = "; expires=" + vEnd.toUTCString();
                      break;
              }
          }
          document.cookie = encodeURIComponent(sKey) + "=" + encodeURIComponent(sValue) + sExpires + (sDomain ? "; domain=" + sDomain : "") + (sPath ? "; path=" + sPath : "") + (bSecure ? "; secure" : "");
          return true;
      },
      remove: function (sKey, sPath, sDomain) {
          if (!this.has(sKey)) {
              return false;
          }
          document.cookie = encodeURIComponent(sKey) + "=; expires=Thu, 01 Jan 1970 00:00:00 GMT" + (sDomain ? "; domain=" + sDomain : "") + (sPath ? "; path=" + sPath : "");
          return true;
      },
      has: function (sKey) {
          if (!sKey) {
              return false;
          }
          return (new RegExp("(?:^|;\\s*)" + encodeURIComponent(sKey).replace(/[\-\.\+\*]/g, "\\$&") + "\\s*\\=")).test(document.cookie);
      },
      keys: function () {
          var aKeys = document.cookie.replace(/((?:^|\s*;)[^\=]+)(?=;|$)|^\s*|\s*(?:\=[^;]*)?(?:\1|$)/g, "").split(/\s*(?:\=[^;]*)?;\s*/);
          for (var nLen = aKeys.length, nIdx = 0; nIdx < nLen; nIdx++) {
              aKeys[nIdx] = decodeURIComponent(aKeys[nIdx]);
          }
          return aKeys;
      }
  };

  /**
   * Loop over active experiments and return experiment data
   */

    if(window.optimizely) {

	    var a = optimizely;

        for (var i in integrator.getRelevantExperimentIds()) {
          var key  = integrator.getRelevantExperimentIds()[i];
          experimentName = a.allExperiments[key].name;
          variationName = a.variationNamesMap[key];

          return experimentName + ': ' + variationName;

        }

  } 
  return undefined;
}

